package Strings.problems;

public class FindDifference {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.println(s.length() + " s length");
        System.out.println(t.length() + " t length");
        int ptr1 = 0, ptr2 = s.length()-1;
        while(ptr1 < s.length() && ptr1 <= ptr2){
            if(!t.contains(s.charAt(ptr1) + "")){
                System.out.println(s.charAt(ptr1));
                break;
            }
            if(!t.contains(s.charAt(ptr2) + "")){
                System.out.println(s.charAt(ptr2));
                break;
            }
            ptr1++;
            ptr2--;
        }
//        for(int i = 0; i < t.length(); i++){
//            if(s.contains(t.charAt(i) + "") == false) {
//                System.out.println(t.charAt(i));
//            }
//        }
    }

}
